}

  HomeScreenData.fromJson(dynamic json) {
    if (json["banner"] != null) {
      _banner = [];
      json["banner"].forEach((v) {
        _banner.add(Banner.fromJson(v));
      });
    }
    if (json["category"] != null) {
      _category = [];
      json["category"].forEach((v) {
        _category.add(Category.fromJson(v));
      });
    }
    if (json["category_ads"] != null) {
      _categoryAds = [];
      json["category_ads"].forEach((v) {
        _categoryAds.add(Category_ads.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    if (_banner != null) {
      map["banner"] = _banner.map((v) => v.toJson()).toList();
    }
    if (_category != null) {
      map["category"] = _category.map((v) => v.toJson()).toList();
    }
    if (_categoryAds != null) {
      map["category_ads"] = _categoryAds.map((v) => v.toJson()).toList();
    }
    return map;
  }

